import React from 'react';
import studentGallery from '../photos/laba.jpg';

const Gallery = () => {
  return (
    <div className='relative mt-10'>
      <div className="relative w-full h-[449px]">
        <img src={studentGallery} alt="Custom Icon" className="w-full h-full opacity-50" />
        <div className="absolute inset-0 bg-gradient-to-b from-transparent to-black"></div>
        <div className="absolute inset-0 flex items-center justify-center text-white">
          <p className="text-6xl font-playfair font-700 text-center">
            Our events gallery
          </p>
        </div>
        <div className="absolute mt-[50px] inset-0 flex items-center justify-center text-white">
            <p className="text-6xl font-playfair font-semibold text-center">
                Events at DBTR are filled with joyous occasions, 
                cultural gatherings, and learning opportunities that bring us all together.
            </p>
        </div>
      </div>
    </div>
  );
};

export default Gallery;
